Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
gotoAndPlay(_parent.近战招式);

if(_parent.防御力 < _parent.基本防御力 * 10)
{
   _parent.防御力 += _parent.基本防御力 * 0.15;
}
if(_parent.空手攻击力 < _parent.基本空手攻击力 * 5)
{
   _parent.空手攻击力 += _parent.基本空手攻击力 * 0.03;
}
_root.效果("黄色音符",_parent._x,_parent._y,100);
_root.效果("灯光增幅",_parent._x,_parent._y,100);

if(random(100) < 80)
{
   if(_parent.防御力 < _parent.基本防御力 * 10)
   {
      _parent.防御力 += _parent.基本防御力 * 0.15;
   }
   if(_parent.空手攻击力 < _parent.基本空手攻击力 * 5)
   {
      _parent.空手攻击力 += _parent.基本空手攻击力 * 0.03;
   }
   _root.效果("黄色音符",_parent._x,_parent._y,100);
   _root.效果("灯光增幅",_parent._x,_parent._y,100);
}

if(random(100) < 50)
{
   if(_parent.防御力 < _parent.基本防御力 * 20)
   {
      _parent.防御力 += _parent.基本防御力 * 0.1;
   }
   if(_parent.空手攻击力 < _parent.基本空手攻击力 * 5)
   {
      _parent.空手攻击力 += _parent.基本空手攻击力 * 0.03;
   }
   _root.效果("黄色音符",_parent._x,_parent._y,100);
   _root.效果("灯光增幅",_parent._x,_parent._y,100);
}

if(random(100) < 80)
{
   if(_parent.防御力 < _parent.基本防御力 * 10)
   {
      _parent.防御力 += _parent.基本防御力 * 0.15;
   }
   if(_parent.空手攻击力 < _parent.基本空手攻击力 * 5)
   {
      _parent.空手攻击力 += _parent.基本空手攻击力 * 0.03;
   }
   _root.效果("黄色音符",_parent._x,_parent._y,100);
   _root.效果("灯光增幅",_parent._x,_parent._y,100);
}

if(random(100) < 50)
{
   if(_parent.防御力 < _parent.基本防御力 * 20)
   {
      _parent.防御力 += _parent.基本防御力 * 0.1;
