function 射击()
{
	var 子弹属性;
	子弹属性 = _root.子弹属性初始化(this.攻击点);
	子弹属性.声音 = "re_MG_m134.wav";
	子弹属性.霰弹值 = 2;
	子弹属性.子弹散射度 = 4;
	子弹属性.发射效果 = "枪火";
	子弹属性.子弹种类 = "横向机枪联弹-加强普通子弹";
	子弹属性.子弹威力 = 1 * _parent.空手攻击力;
	子弹属性.子弹速度 = 36;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 24;
	子弹属性.击中后子弹的效果 = "";
	子弹属性.子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot传递(子弹属性);
}


function 火箭弹射击()
{
	var 子弹属性 = _root.子弹属性初始化(this.攻击点);
	子弹属性.声音 = "shoot.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 3;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "普通火箭弹";
	子弹属性.子弹威力 = 5 * _parent.空手攻击力;
	子弹属性.子弹速度 = 15;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 35;
	子弹属性.击倒率 = 1;
	子弹属性.击中后子弹的效果 = "";
	子弹属性.子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot传递(子弹属性);
}

function 透明攻击(倍率,Z轴攻击范围)
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 1;
	子弹属性.子弹种类 = "透明子弹";
	子弹属性.子弹威力 = _parent.空手攻击力 * 倍率;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = Z轴攻击范围;
	子弹属性.击倒率 = 50;

	//子弹属性.最小霰弹值 = 3;

	子弹属性.伤害类型 = "魔法";
	子弹属性.魔法伤害属性 = "热";

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}

function 烈炎炮射击()
{
	var 子弹属性 = _root.子弹属性初始化(this.攻击点);
	子弹属性.声音 = "shoot.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 1;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "穿刺烈炎炮弹";
	子弹属性.子弹威力 = 10 * _parent.空手攻击力;
	子弹属性.子弹速度 = 50;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 60;
	子弹属性.击倒率 = 0.1;
	子弹属性.击中后子弹的效果 = "";
	子弹属性.伤害类型 = "魔法";
	子弹属性.魔法伤害属性 = "热";
	子弹属性.子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot传递(子弹属性);
}

if(_parent.近战招式 == "烈炎炮"){
	gotoAndPlay("烈炎炮跳转");
}else if(_parent.近战招式 == "广域喷火"){
	gotoAndPlay("广域喷火跳转");
}

if (_parent.近战招式 == "导弹炮")
{
	gotoAndPlay("结束动画");
}
else
{
	距离X = _root.gameworld[_parent.攻击目标]._x - _parent._x;
	if (_root.gameworld[_parent.攻击目标].hp > 0)
	{
		if (距离X > 0)
		{
			_parent.方向改变("右");
		}
		else
		{
			_parent.方向改变("左");
		}
	}else{
		gotoAndPlay("结束动画");
	}
}

if(_parent.近战招式 == "广域喷火"){
	gotoAndPlay("结束动画");
}
else
{
	距离X = _root.gameworld[_parent.攻击目标]._x - _parent._x;
	if (_root.gameworld[_parent.攻击目标].hp > 0)
	{
		if (距离X > 0)
		{
			_parent.方向改变("右");
		}
		else
		{
			_parent.方向改变("左");
		}
	}else{
		gotoAndPlay("结束动画");
	}
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 5;
   子弹散射度 = 5;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力 * 0.3;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 30;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

